def get_most_related(resolved_data: List[dict], seed_data: dict) -> RelatedAdsResponse:
    InternalLogger.LogDebug(f"resolved_data {resolved_data}")
    InternalLogger.LogDebug(f"seed_data {seed_data}")
    InternalLogger.LogDebug(f"type of seed_data: {type(resolved_data)}")
    InternalLogger.LogDebug(f"type seed_data {type(seed_data)}")
    sorted_by_mileage = resolved_data

    _pre_sorted_by_production_year: list = []
    total_ads = len(sorted_by_mileage)
    closest_by_production_year_required = get_portion_length(total_ads) 
    while len(_pre_sorted_by_production_year) < closest_by_production_year_required:
        closest = get_closest_production_year_item(sorted_by_mileage, seed_data)
        _pre_sorted_by_production_year.append(closest)
        sorted_by_mileage.remove(closest)

    _pre_sorted_by_mileage: list = []

    closest_by_mileage_required = get_portion_length(len(_pre_sorted_by_production_year)) 
    while len(_pre_sorted_by_mileage) < closest_by_mileage_required:
        closest = get_closest_mileage_item(_pre_sorted_by_production_year, seed_data)
        _pre_sorted_by_mileage.append(closest)
        _pre_sorted_by_production_year.remove(closest)

    return RelatedAdsResponse(RelatedAds=[build_ad_item(item) for item in _pre_sorted_by_mileage] )

def get_closest_mileage_item(resolved_data: List[dict], seed_data: dict) -> dict:
    return min(resolved_data, key=lambda x: abs(int(x["Mileage"]) - seed_data["Mileage"]))

def get_closest_production_year_item(resolved_data: List[dict], seed_data: dict) -> dict:
    return min(resolved_data, key=lambda x: abs(int(x["ProductionYear"]) - seed_data["ProductionYear"]))

def build_ad_item(item: dict) -> AdItem:
    return AdItem(
        Price=item["Price"],
        PriceCurrency=item["PriceCurrency"],
        Mileage=item["Mileage"],
        ProductionYear=item["ProductionYear"],
        FuelType=item["FuelType"],
        Transmision=item["Transmision"],
        HorsePower=item["HorsePower"],
        Capacity=item["Capacity"],
        AdvertisementLink=item["AdvertisementLink"],
        Thumbnails=item["Thumbnails"],
        Source=item["Source"]
    )

def get_portion_length(total_ads: int) -> int:
    return math.ceil(total_ads * 0.3)